import React from 'react';
import './ImageGallery.css';

const TESTIMONIALS = [
  { company: 'Subway Örebro / Arboga', author: 'Falah Hamade', title: 'DSV Transport / JetPak', excerpt: 'Jag har varit egenföretagare i över 20 år och har under den tiden anlitat olika byråer. Skillnaden med One Redovisning är att de verkligen känns som en del av mitt företag.' },
  { company: 'Oscarssons El AB', author: 'Anders Schöllin', title: '', excerpt: 'Vi har arbetat med One Redovisning i 1,5 år, och allt fungerar väldigt smidigt. Kommunikation och tillgänglighet är alltid på topp.' },
  { company: 'Rallarrosen Bygg och Fastighet AB', author: 'Jenny Åström', title: '', excerpt: 'Vi påbörjade samarbetet efter en rekommendation och märker redan stora skillnader i vår ekonomi- och rapportering.' },
  { company: 'Kameleon Robotics', author: 'Niklas Quvang', title: 'VD', excerpt: 'Jesper och teamet blev precis den samarbetspartner vi behövde för att skala vår verksamhet.' },
];

export default function ImageGallery(){
  return (
    <section className="testimonials" aria-labelledby="testimonials-heading">
      <div className="testimonials-hero">
        <small className="eyebrow">GREAT ACCOUNTING SWEDEN AB</small>
        <h2 id="testimonials-heading">Vad säger våra kunder</h2>
        <p className="sub">Vi är otroligt stolta över alla våra nöjda kunder och anstränger oss lite extra för att ni ska känna er väl omhändertagna</p>
      </div>

      <div className="testimonials-grid">
        {TESTIMONIALS.map((t, i) => (
          <article key={i} className="testimonial-card">
            <div className="card-inner">
              <h3 className="card-company">{t.company}</h3>
              <small className="card-author">Av {t.author}{t.title ? `, ${t.title}` : ''}</small>
              <h4 className="card-heading">Om samarbetet</h4>
              <p className="card-text">{t.excerpt}</p>
              <a className="card-cta" href="/testimonials">Läs mer</a>
            </div>
          </article>
        ))}
      </div>
    </section>
  );
}
